// RegisterHandlers adds each server route to the EchoRouter.
func RegisterHandlers(router EchoRouter, si ServerInterface) {
	RegisterHandlersWithBaseURL(router, si, "")
}

// Registers handlers, and prepends BaseURL to the paths, so that the paths
// can be served under a prefix.
func RegisterHandlersWithBaseURL(router EchoRouter, si ServerInterface, baseURL string) {

	wrapper := ServerInterfaceWrapper{
		Handler: si,
	}

	router.DELETE(baseURL+"/ocpi/2.2.1/credentials", wrapper.DeleteOcpi221Credentials)
	router.GET(baseURL+"/ocpi/2.2.1/credentials", wrapper.GetOcpi221Credentials)
	router.POST(baseURL+"/ocpi/2.2.1/credentials", wrapper.PostOcpi221Credentials)
	router.PUT(baseURL+"/ocpi/2.2.1/credentials", wrapper.PutOcpi221Credentials)
	router.GET(baseURL+"/ocpi/2.2.1/details", wrapper.GetOcpi221Details)
	router.GET(baseURL+"/ocpi/cdrs", wrapper.GetOcpiCdrs)
	router.POST(baseURL+"/ocpi/cdrs", wrapper.PostOcpiCdrs)
	router.POST(baseURL+"/ocpi/chargingprofile", wrapper.PostOcpiChargingprofile)
	router.PUT(baseURL+"/ocpi/chargingprofile/:session_id", wrapper.PutOcpiChargingprofileSessionId)
	router.PUT(baseURL+"/ocpi/chargingprofiles/:session_id", wrapper.PutOcpiChargingprofilesSessionId)
	router.GET(baseURL+"/ocpi/chargingprofiles/:session_id/:duration/:response_url", wrapper.GetOcpiChargingprofilesSessionIdDurationResponseUrl)
	router.DELETE(baseURL+"/ocpi/chargingprofiles/:session_id/:response_url", wrapper.DeleteOcpiChargingprofilesSessionIdResponseUrl)
	router.GET(baseURL+"/ocpi/clientinfo/:country_code/:party_id", wrapper.GetOcpiClientinfoCountryCodePartyId)
	router.PUT(baseURL+"/ocpi/clientinfo/:country_code/:party_id", wrapper.PutOcpiClientinfoCountryCodePartyId)
	router.POST(baseURL+"/ocpi/commands/:command", wrapper.PostOcpiCommandsCommand)
	router.POST(baseURL+"/ocpi/commands/:command/:uid", wrapper.PostOcpiCommandsCommandUid)
	router.GET(baseURL+"/ocpi/hubclientinfo", wrapper.GetOcpiHubclientinfo)
	router.GET(baseURL+"/ocpi/locations", wrapper.GetOcpiLocations)
	router.GET(baseURL+"/ocpi/locations/:country_code/:party_id/:location_id", wrapper.GetOcpiLocationsCountryCodePartyIdLocationId)
	router.PATCH(baseURL+"/ocpi/locations/:country_code/:party_id/:location_id", wrapper.PatchOcpiLocationsCountryCodePartyIdLocationId)
	router.PUT(baseURL+"/ocpi/locations/:country_code/:party_id/:location_id", wrapper.PutOcpiLocationsCountryCodePartyIdLocationId)
	router.GET(baseURL+"/ocpi/locations/:location_id", wrapper.GetOcpiLocationsLocationId)
	router.GET(baseURL+"/ocpi/sessions", wrapper.GetOcpiSessions)
	router.GET(baseURL+"/ocpi/sessions/:country_code/:party_id/:session_id", wrapper.GetOcpiSessionsCountryCodePartyIdSessionId)
	router.PATCH(baseURL+"/ocpi/sessions/:country_code/:party_id/:session_id", wrapper.PatchOcpiSessionsCountryCodePartyIdSessionId)
	router.PUT(baseURL+"/ocpi/sessions/:country_code/:party_id/:session_id", wrapper.PutOcpiSessionsCountryCodePartyIdSessionId)
	router.PUT(baseURL+"/ocpi/sessions/:session_id/charging_preferences", wrapper.PutOcpiSessionsSessionIdChargingPreferences)
	router.GET(baseURL+"/ocpi/tariffs", wrapper.GetOcpiTariffs)
	router.DELETE(baseURL+"/ocpi/tariffs/:country_code/:party_id/:tariff_id", wrapper.DeleteOcpiTariffsCountryCodePartyIdTariffId)
	router.GET(baseURL+"/ocpi/tariffs/:country_code/:party_id/:tariff_id", wrapper.GetOcpiTariffsCountryCodePartyIdTariffId)
	router.PUT(baseURL+"/ocpi/tariffs/:country_code/:party_id/:tariff_id", wrapper.PutOcpiTariffsCountryCodePartyIdTariffId)
	router.GET(baseURL+"/ocpi/tokens", wrapper.GetOcpiTokens)
	router.GET(baseURL+"/ocpi/tokens/:country_code/:party_id/:token_uid", wrapper.GetOcpiTokensCountryCodePartyIdTokenUid)
	router.PATCH(baseURL+"/ocpi/tokens/:country_code/:party_id/:token_uid", wrapper.PatchOcpiTokensCountryCodePartyIdTokenUid)
	router.PUT(baseURL+"/ocpi/tokens/:country_code/:party_id/:token_uid", wrapper.PutOcpiTokensCountryCodePartyIdTokenUid)
	router.GET(baseURL+"/ocpi/versions", wrapper.GetOcpiVersions)
	router.POST(baseURL+"/ocpi/:token_uid/authorize", wrapper.PostOcpiTokenUidAuthorize)

}

